import Head from 'next/head';

const Layout = (props) => (
    <div>
        <Head>
            <title>listing -page</title>
            <link href="../../../static/style.css" rel="stylesheet" />
        </Head>
        <h1>Navigation</h1>
           {props.children}
        <h1>footer</h1>
    </div>
)
export default Layout;
